import React from 'react';
import LoginForm from './LoginRegister/LoginForm';
import TypedAnimation from './Animations/TypeAnimation';
import './App.css';
import GoogleButton from 'react-google-button'

function App() {
  return (
    <div className="app">

      <div className="left">
        <div className="loginText">
        <h4>Hii Again!!</h4>
      <h6>Login to continue documenting</h6>
      <GoogleButton
  onClick={() => { console.log('Google button clicked') }}
/>
        </div>
        <LoginForm />
        <div class='loginFooter'>
  <p><a href="forgot_password_page.html">Forgot password?</a></p>
  <p><a href="signup_page.html">Don't have an account?</a></p>
</div>

      </div>
      <div className="right">
        <div className="logo">
        <img src={process.env.PUBLIC_URL + 'superman-seeklogo.svg'} alt="Logo" style={{ backgroundColor: 'transparent' }} />

        </div>
        <div className="text">
          <TypedAnimation />
        </div>
      </div>
    </div>
  );
}

export default App;
